import React, { useState, useEffect } from 'react';
import {
  Timeline,
  TimelineItem,
  TimelineSeparator,
  TimelineConnector,
  TimelineContent,
  TimelineOppositeContent,
} from '@mui/lab';
import Typography from '@mui/material/Typography';

import untitled from './image/Untitled.png';
import MosGames from './image/Mo\'s Games logo.png';
import mohammedGithub from './image/Mohammed_github.png';
import Nodejs from './image/node.png'
import theresidentsclub from './image/theresidentsclub.png';
import clearear from './image/Clearear.jpg';
import Javascript from './image/javascript.png';
import react from './image/React.png';
import Python from './image/python.png';
import SQL from './image/sql-logo.png';
import kotlin from './image/kotlin.png';
import selenium from './image/Selenium.png';
import renuem from './image/Renuem.png';

const MainContent = () => {
  const [isMobileView, setIsMobileView] = useState(false);
  const [tooltipVisible, setTooltipVisible] = useState({});

  useEffect(() => {
    const updateView = () => setIsMobileView(window.innerWidth <= 1050);
    updateView();
    window.addEventListener('resize', updateView);
    return () => window.removeEventListener('resize', updateView);
  }, []);

  const handleLogoHover = (id) => {
    setTooltipVisible({ ...tooltipVisible, [id]: true });
  };

  const handleLogoLeave = (id) => {
    setTooltipVisible({ ...tooltipVisible, [id]: false });
  };

  const styles = {
    main: {
      paddingLeft: '300px', // Padding at the start
      paddingRight: '300px', // Padding at the end
      background: 'linear-gradient(to bottom, #253041, #2a2858)', // Subtle blue to muted purple gradient
      color: '#C9D1D9',
      minHeight: '100vh',
      fontFamily: "'Roboto', sans-serif",
      boxSizing: 'border-box', // Ensures padding is included in width calculations
    },
    heroSection: {
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      gap: '2rem',
      flexDirection: isMobileView ? 'column' : 'row',
      marginTop: '6rem',
      padding: '0 2rem',
    },
    image: {
      width: isMobileView ? '50%' : '15%',
      borderRadius: '5%',
      marginTop:'50px'
    },
    paragraph: {
      fontSize: isMobileView ? '18px' : '20px',
      textAlign: 'left',
      lineHeight: '1.6',
      maxWidth: isMobileView ? '95%' : '50%',
    },
    sectionHeader: {
      textAlign: 'center',
      margin: '4rem 0 2rem',
      color: '#aaa',
      fontWeight: 'normal',
      fontSize: isMobileView ? '1.2rem' : '1.5rem',
    },
    logoContainer: {
      display: 'flex',
      justifyContent: 'space-evenly',
      gap: '2rem',
      margin: '2rem 0',
    },
    logo: {
      width: isMobileView ? '30px' : '50px',
      filter: 'grayscale(100%)',
      transition: 'filter 0.3s ease-in-out',
    },
    tooltip: {
      position: 'absolute',
      backgroundColor: '#555',
      color: '#fff',
      padding: '5px 10px',
      borderRadius: '6px',
      fontSize: '12px',
      bottom: '130%',
      left: '50%',
      transform: 'translateX(-50%)',
      whiteSpace: 'nowrap',
      zIndex: '1',
      visibility: 'hidden',
      opacity: 0,
      transition: 'opacity 0.2s ease-in-out',
    },
    tooltipVisible: {
      visibility: 'visible',
      opacity: 1,
    },
  };

  const techLanguages = [
    { id: 'javascript', src: Javascript, name: 'Javascript' },
    { id: 'react', src: react, name: 'React.js' },
    { id: 'Node.js', src: Nodejs, name: 'Node.js' },
    { id: 'python', src: Python, name: 'Python' },
    { id: 'SQL', src: SQL, name: 'SQL' },
    { id: 'kotlin', src: kotlin, name: 'Kotlin' },
    { id: 'selenium', src: selenium, name: 'Selenium' },
    
  ];

  const workHistory = [
    {
        id: '2024-present',
        icon: renuem,
        title: '🌍 Lead Full Stack Developer - Renuem',
        description: `
         🔋About Renuem:  
        Renuem is a platform that democratizes access to renewable energy investments. By leveraging blockchain and innovative technologies, 
        Renuem connects retail investors with global renewable energy projects, allowing them to invest in clean energy, earn sustainable returns, 
        and contribute to reducing carbon emissions.

        👨‍💻 My Role: 
        As Lead Full Stack Developer at Renuem, I oversee the development of both mobile and web applications. My responsibilities include:  
        - Leading a team of developers in building scalable, secure, and user-friendly systems.
        - Working with React Native for mobile apps and Node.js for the backend.
        - Integrating blockchain for transaction transparency and ensuring compliance with industry regulations.  
        - I also play a key role in implementing real-time performance metrics and advanced data analytics features to enhance the user experience and improve investor insights.  
        `,
    },
    {
        id: '2023-2024',
        icon: clearear,
        title: '💼 Senior Full Stack Developer - Clear Ear',
        description: `
        🏥 About Clear Ear:  
        Clear Ear is a healthcare tech company that specializes in digital solutions to improve appointment management for healthcare providers. 
        Their platform reduces no-shows, automates scheduling, and integrates seamlessly with clinic management systems.

        👨‍💻 My Role: 
        At Clear Ear, I led the development of the appointment management system, contributing to both the frontend and backend:  
        - Designed backend architecture using Node.js and integrated third-party APIs for patient records.  
        - Developed dynamic, responsive frontend with React to improve user experience.  
        - Automated scheduling workflows and implemented real-time notifications, helping healthcare providers increase operational efficiency.  
        - Focused on data security to ensure patient privacy while enabling real-time tracking and reporting.  
        `,
    },
    {
        id: '2022-2023',
        icon: mohammedGithub,
        title: '👨‍💻 Freelance Full Stack Developer & Data Analyst',
        description: `
        🔎 About My Freelance Work:  
        As a freelance Full Stack Developer and Data Analyst, I provided custom software development and data analysis solutions for small businesses and startups.  
        My services included building web applications, creating data pipelines, and designing dashboards to help clients make data-driven decisions.

        👨‍💻 My Role:  
        - Developed end-to-end web applications using React, Node.js, and other modern technologies.  
        - Built data pipelines with Python and SQL to process and analyze business data.  
        - Created interactive data visualization dashboards, allowing clients to monitor and track key performance indicators in real time.  
        - Provided actionable insights that helped businesses optimize operations and improve customer engagement.  
        `,
    },
    {
        id: '2022-2023',
        icon: mohammedGithub,
        title: '⚙️ Software Engineer - Freelance Projects',
        description: `
        🖥️ About My Freelance Projects:  
        As a freelance Software Engineer, I worked on a variety of software development projects, focusing on improving performance, security, and scalability in existing applications.

        👨‍💻 My Role:
        - Refactored and optimized backend services built with Node.js to handle increased traffic.  
        - Ensured fast response times while scaling applications for higher user loads.  
        - Worked on frontend development, using React to create clean, responsive interfaces.  
        - Enhanced overall performance and user experience by applying best practices in coding, version control, and deployment.  
        `,
    },
    {
        id: '2021-2023',
        icon: theresidentsclub,
        title: '🏢 Lead IT Manager - The Residents Club',
        description: `
        🏡 About The Residents Club: 
        The Residents Club is a luxury residential community offering smart home features, high-end security, and amenities tailored to its residents' needs.

        👨‍💻 My Role:  
        - Managed IT infrastructure for the club, including smart home integrations, network security, and resident-facing applications.  
        - Led a team responsible for ensuring the systems ran smoothly and securely.  
        - Developed analytics tools to track energy consumption, waste management, and resident satisfaction.  
        - Provided actionable insights to improve sustainability and service delivery while maintaining a seamless resident experience.  
        `,
    },
    {
        id: '2020-2023',
        icon: MosGames,
        title: '🎮 Founder & General Manager - Mo\'s Games',
        description: `
        🎮 About Mo's Games:  
        Mo's Games is a popular gaming lounge offering high-end equipment, a wide variety of games, and a space for gamers to socialize, compete, and participate in tournaments.

        👨‍💻 My Role: 
        - As the founder and general manager, I was responsible for all aspects of the business, including operations, strategy, and marketing.  
        - Developed a custom point-of-sale (POS) system to manage bookings, payments, and inventory.  
        - Led marketing efforts, including organizing gaming tournaments and promoting the lounge on social media.  
        - Focused on customer satisfaction and business growth while managing day-to-day operations.  
        - Set up and maintained gaming infrastructure, ensuring the best possible experience for all customers.  
        `,
    },
];



  return (
    <div style={styles.main}>
      <div style={styles.heroSection}>
        <img src={untitled} alt="Mohammed" style={styles.image} />
        <div style={styles.paragraph}>
          <p>
            With over 7 years of experience as a Full Stack Developer and Data Analyst, I’ve built my career
            around designing efficient, user-focused solutions that bridge technical innovation with real-world impact.
            My expertise spans front-end and back-end development, leveraging tools like React Native, Node.js, and
            database management to create scalable applications for startups and enterprises.
          </p>
          <p>
            I’ve also been fortunate to combine my technical skills with entrepreneurial insight. For instance, I played
            a key role in launching innovative ventures, such as introducing fruit bubble tea to the Pakistani market while
            managing a dynamic gaming lounge in Lahore. This experience sharpened my ability to analyze market trends, lead
            teams, and deliver customer-centric solutions.
          </p>
          <p>
            Outside of work, I’m always exploring the latest in technology, tackling coding challenges, and pursuing hobbies
            like gaming, photography, and solving puzzles. I believe in continually refining my skills while staying grounded
            in creativity and innovation.
          </p>
          <p>
            If you’re interested in learning more about my projects or discussing collaboration opportunities, feel free to
            explore further.
          </p>
        </div>
      </div>

      <h3 style={styles.sectionHeader}>Tech Languages</h3>
      <div style={styles.logoContainer}>
        {techLanguages.map(({ id, src, name }) => (
          <div
            key={id}
            style={{ position: 'relative' }}
            onMouseEnter={() => handleLogoHover(id)}
            onMouseLeave={() => handleLogoLeave(id)}
          >
            <img
              id={id}
              src={src}
              alt={name}
              style={styles.logo}
              onMouseEnter={(e) => (e.currentTarget.style.filter = 'grayscale(0%)')}
              onMouseLeave={(e) => (e.currentTarget.style.filter = 'grayscale(100%)')}
            />
            <div
              style={{
                ...styles.tooltip,
                ...(tooltipVisible[id] ? styles.tooltipVisible : {}),
              }}
            >
              {name}
            </div>
          </div>
        ))}
      </div>

      <h3 style={styles.sectionHeader}>Work History</h3>
      <Timeline position={isMobileView ? 'right' : 'alternate'}>
        {workHistory.map(({ id, icon, title, description }) => (
          <TimelineItem key={id}>
            <TimelineOppositeContent
              sx={{ m: 'auto 0' }}
              align="right"
              variant="body2"
              color="#808080"
            >
              {id}
            </TimelineOppositeContent>
            <TimelineSeparator>
              <TimelineConnector />
              <img src={icon} alt={title} style={{ width: '30px', borderRadius: '50%' }} />
              <TimelineConnector />
            </TimelineSeparator>
            <TimelineContent sx={{ py: '12px', px: 2 }}>
              <Typography variant="h6" component="span">{title}</Typography>
              <Typography>{description}</Typography>
            </TimelineContent>
          </TimelineItem>
        ))}
      </Timeline>
    </div>
  );
};

export default MainContent;
